import React from "react";
import { Container, CardBody, Card } from "reactstrap";

const Skills = props => {
  return (
    <Container>
      <div className="section section-nucleo-icons">
        <Container>
          <h2 className="title" style={{textAlign :'left'}}>Skills</h2>
          <Card>
            <CardBody>
              <div>
                <div className="icons-container on-screen mt-5 mb-5">
                  {/* Center */}
                  <i className="icon tim-icons devicon-nodejs-plain" />
                  {/* Right 1 */}
                  <i className="icon icon-sm tim-icons devicon-html5-plain" />
                  <i className="icon tim-icons devicon-python-plain" />
                  <i className="icon tim-icons devicon-c-plain" />

                  {/* Right 2 */}
                  <i className="icon tim-icons devicon-android-plain" />
                  <i className="icon tim-icons devicon-rails-plain" />
                  <i className="icon tim-icons devicon-java-plain" />
                  {/* Left 1 */}
                  <i className="icon icon-sm tim-icons devicon-postgresql-plain" />
                  <i className="icon icon-sm tim-icons devicon-mongodb-plain" />
                  <i className="icon icon-sm tim-icons devicon-mysql-plain" />

                  {/* Left 2 */}
                  <i className="icon tim-icons devicon-django-line" />
                  <i className="icon tim-icons devicon-react-original" />
                  <i className="icon tim-icons devicon-express-original" />
                </div>
              </div>
            </CardBody>
          </Card>
        </Container>
      </div>
    </Container>
  );

}

export default Skills;
